import { Input, Form, Button } from "antd";


const PostCardForm = () => {
  return (
    <Form onFinish={onsubmit}>
      <Form.Item placeholder="내용을 작성해주세요">
        <Input.TextArea />
      </Form.Item>
        <Button type="primary" htmlType="submit">
          Submit
        </Button>
      <Button type="primary">
        Image Upload
      </Button>
    </Form>
  );
};

export default PostCardForm;
